<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <style>
      @import url("https://fonts.googleapis.com/css2?family=Inter&display=swap");

body {
  background-color: #111111;
  text-align: center;
  font-family: "Inter", sans-serif;
  margin-right: auto;
  grid-gap: 2rem;
  position: absolute;
  top: 105px;
  left: 2%;
  right: 2%;
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
  margin-top: 9vh;
}
.card {
  transition: 0.3s;
  border-radius: 30px;
  width: 30%;
  height: 400px;
  color: white;
  background-color: rgba(34, 34, 34, 0.7);
  max-height: 100%;
  border: none;
  box-shadow: 0 12px 16px 0 rgba(0, 0, 0, 0.24),
    0 17px 50px 0 rgba(0, 0, 0, 0.19);
  padding: 5px;
  flex-wrap: wrap;
  justify-content: center;
  align-items: center;
}

#presets {
  gap: 10px;
}

.card:hover {
  box-shadow: 0 12px 16px 0 rgba(0, 0, 0, 0.08),
    0 17px 50px 0 rgba(0, 0, 0, 0.05), 0 4px 4px 0 rgba(0, 0, 0, 0.12),
    0 7px 14px 0 rgba(0, 0, 0, 0.09);
  transform: scale(1.05);
}

p {
  margin-top: 6px;
  font-family: "Inter", sans-serif;
  font-weight: 5px;
}

h2 {
  text-align: center;
}

img {
  border-radius: 5px 5px 0 0;
  width: 30px;
  height: 30px;
}
button {
  font-family: "Inter", sans-serif;
  padding: 12px;
  background-color: #333333;
  color: white;
  cursor: pointer;
  border: none;
  border-radius: 5px;
  box-shadow: 0 4px 4px 0 rgba(0, 0, 0, 0.2),
    0 6px 20px 0 rgba(0, 0, 0, 0.19);
  margin: 4px;
}

.preset {
  font-family: "Inter", sans-serif;
  padding: 12px;
  background-color: #333333;
  color: white;
  cursor: pointer;
  border: none;
  border-radius: 5px;
  box-shadow: 0 4px 4px 0 rgba(0, 0, 0, 0.2),
    0 6px 20px 0 rgba(0, 0, 0, 0.19);
  width: 100px;
  height: 100px;
  gap: 10px;
}

button:hover {
  background-color: #444444;
}
input {
  font-family: "Inter", sans-serif;
  background-color: #333333;
  color: white;
  transition: all 0.2s ease-in-out;
  padding: 5px;
  border: none;
  border-radius: 4px;
  box-shadow: 0 4px 4px 0 rgba(0, 0, 0, 0.2),
    0 4px 8px 0 rgba(0, 0, 0, 0.15);
}

input:hover {
  opacity: 0.8;
}
input:focus {
  outline: none;
  opacity: 0.6;
}
input[type="text"] {
  height: 40px;
  width: 80%;
  margin-bottom: 10px;
}
    </style>
